function List(props) {
  return (
    <div>
      <h1>Lista de Pokemon</h1>;
      <ul>
        {props.pokedata.map((pokemon, index) => {
          return (
            <li key={index}>
              {pokemon.name}
              <a href={pokemon.url}></a>
            </li>
          );
        })}
      </ul>
    </div>
  );
}

export default List;
